    <script>
        function init() {
            infoDiv = document.querySelector('#infoDiv');
            listDiv = document.querySelector('#listDiv');
            label = document.querySelector('label');
            scaleTrafo = document.querySelector('#scaleTrafo');
            roverTrafo = document.querySelector('#roverTrafo');
            yScale = 5;
            yDatum = -2570;
            nPoints = 10;
            roverPos1 = new x3dom.fields.SFVec3f(4590876.63, 0.5 / yScale,-1093301.70);
            roverPos2 = "4590880.59 1093297.35 -2569.90";
            turnAt2 = 150;
            roverPos3 = "4590880.87 1093294.80 -2569.90";
            
            pointStack = [{
                pos: new x3dom.fields.SFVec3f(roverPos1.x, roverPos1.y * yScale, roverPos1.z),
                dst: 0
            }];
        }

        function mousemove(e) {
            infoDiv.textContent = `X Y elevation: ` + [e.worldX, -e.worldZ, e.worldY / yScale + yDatum].map(prettify).join(" ");

        }
        function prettify(x) {
            return x.toFixed(2);
        }
        function mouseclick(e) {
            var prev = pointStack[0];
            var pos = new x3dom.fields.SFVec3f(e.worldX,e.worldY / yScale + yDatum,e.worldZ);
            if (prev.pos.equals(pos, 0.01)) // assume double click
            {
                pointStack.shift();
            } else {
                var point = {
                    pos: pos,
                    dst: pos.subtract(prev.pos).length()
                };
                var n = pointStack.unshift(point);
            }
            listDiv.textContent = "clicked points, distance from last [m]:\n\n" + pointStack.slice(0, nPoints).map(ppPoint).join("\n");
            function ppPoint(p) {
                return [p.pos.x, -p.pos.z, p.pos.y, p.dst].map(prettify).join(' ')
            }
        }
        function scaleY(e) {
            yScale = parseFloat(e);
            label.textContent = yScale.toFixed(1) + ' x v.e.';
            scaleTrafo.scale = [1, yScale, 1].join();
            roverTrafo.translation = [roverPos.x, roverPos.y * yScale, roverPos.z].join();
        }
    </script>
